import logo from './logo.svg';
import './styles.css';
import Home from './home';
import Header from './Components/Header';
import Footer from './Components/Footer';
import MovieGrid from './Components/MovieGrid';

function App() {
  return (
    <div className="App">
      <div className='container'>
        <Header/>
      </div> 
      <MovieGrid/>
      <Footer/>
    </div>
  );
}

export default App;
